INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24001, 102601, 10040, 0.0, "2020/04/30 12:00:00", 1, 0.0, 0.0, "あたしだって\nやるときはやるよ！", "リン", 24, 0, 1);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24002, 102601, 10040, 0.0, "2020/04/30 12:00:00", 1, 0.0, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", "リン", 24, 1, 1);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24003, 102601, 10040, 0.0, "2020/04/30 12:00:00", 1, 0.0, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", "リン", 24, 2, 1);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24004, 102601, 10040, 0.0, "2020/04/30 12:00:00", 2, 0.0, 0.0, "やったね！\nこれでようやく\nサボれるよ…", "リン", 24, 3, 2);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24005, 102601, 10040, 0.0, "2020/04/30 12:00:00", 1, 0.0, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "リン", 24, 4, 1);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24006, 102601, 10040, 0.0, "2020/04/30 12:00:00", 2, 0.0, 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "リン", 24, 5, 2);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24007, 102601, 10040, 0.0, "2020/04/30 12:00:00", 2, 0.0, 0.0, "あたしも意外と\nやるもんでしょ？", "リン", 24, 6, 2);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24008, 102601, 10040, 0.0, "2020/04/30 12:00:00", 4, 0.0, 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "リン", 24, 7, 4);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24009, 102601, 10040, 0.0, "2020/04/30 12:00:00", 4, 0.0, 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", "リン", 24, 8, 4);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24010, 102601, 10040, 0.0, "2020/04/30 12:00:00", 4, 0.0, 0.0, "まじめに\nやったんだけどな…\n悔しいな～", "リン", 24, 9, 4);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24011, 102601, 10040, 0.0, "2020/04/30 12:00:00", 4, 0.0, 0.0, "やられた…\nねずみって意外と\nてごわいね", "リン", 24, 10, 4);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24012, 102601, 10040, 0.0, "2020/04/30 12:00:00", 4, 0.0, 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", "リン", 24, 11, 4);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2030/12/17 14:59:59", 24013, 102601, 10040, 1.81, "2020/04/30 12:00:00", 1, 0.0, 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…", "リン", 24, 12, 4);
